import React from "react";
import axios from "axios";
import { Button } from 'semantic-ui-react'
import {Link, } from 'react-router-dom';


function CategoriesCell({categories}){
    const categoriesAvaUrl = axios.defaults.baseURL + 'uploads/images/games/Categories/' + categories.CategoryName;

    return (
        <div>
        <Link to='#' component={() => <CategoriesCell categories={categories}/>}>
            <a className="game-type-link" href={'#' + categories.CategoryName}>
                <img className="game-type__img" src={categoriesAvaUrl} alt="Cannot get categories image" />
                <div className="game-type__name">{categories.CategoryName}</div>
            </a>
        </Link>
        <h3> {categories.CategoryName} </h3>
        <a className="categories-type-link">
            <img className="categories-type__img" src={categoriesAvaUrl} alt="Cannot get categories image" />
            <div className="categories-type__name">{categories.CategoryName}</div>
        </a>
    </div>
    );
}

export default CategoriesCell;
